import { Home, Contact, AboutUs } from '~/pages';

// Không cần đăng nhập mới xem đc
export const publicRoutes = [
    {
        path: '/',
        co: Home,
    },
    {
        path: '/aboutUs',
        element: AboutUs,
    },
    {
        path: '/contact',
        element: Contact,
    },
];
// Cần đăng nhập mới xem đc
export const privateRoutes = [];
